INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 0, "お！\nあそこに困ってそうな人発見！", 2, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, "春咲 ひより", 0, 0, 1, 1.4, 1, 1001);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 0, "大切な人を\n守れるようになりたい…って", 2, 0, "みんなみたいに\nわたしも強くならなきゃ", 1, "草野 優衣", 0, 0, 1, 1.4, 1, 1002);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("少しは磨かれると思いますよ。", 0, 0, "キミに必要な集中力と感性が", 2, 0, "フェンシングを始めてみては？", 1, "士条 怜", 0, 0, 1, 1.4, 1, 1003);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("みそぎはねぇ、\nかくれんぼやりたい！", 0, 0, "今日はなにして遊ぶ？", 2, 0, "ねぇ、にいちゃん！", 1, "穂高 みそぎ", 0, 0, 1, 1.5, 1, 1004);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("私といっしょに…\nいかない？", 0, 0, "ねぇ…", 2, 0, "風宮あかりです", 1, "風宮 あかり", 0, 0, 1, 1.4, 1, 1006);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("食べ物の恨みは怖いのー", 0, 0, "プリンたべたいのー", 2, 0, "出雲宮子なのー", 1, "出雲 宮子", 0, 0, 1, 1.5, 1, 1007);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("いいよ。\n見られることは運命さ…", 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 0, "ボクは虹村雪。", 1, "虹村 雪", 0, 0, 1, 1.4, 1, 1008);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("人呼んで「疾風の冥姫」!!", 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 0, "フッ…聞いて後悔するがいい！", 1, "柊杏奈", 0, 0, 1, 1.4, 1, 1009);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ほんまおおきにやわ～♪", 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, "姫宮 真歩", 0, 0, 1, 1.5, 1, 1010);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ここで会ったが\n100年目～！", 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 2, 0, "衣之咲璃乃です！", 1, "衣之咲 璃乃", 0, 0, 1, 1.4, 1, 1011);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("…って、お願い！\n誰にも言わないでおいて～！", 0, 0, "ち、超能力って…\n何のことかな～？", 2, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, "柏崎 初音", 0, 0, 1, 1.4, 1, 1012);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 0, "一応カリスマ読モJKやってまっす！", 2, 0, "ちょす！\n美波鈴奈だよ～♪", 1, "美波 鈴奈", 0, 0, 1, 1.4, 1, 1016);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("でも、沖縄もとってもいいとこさー", 0, 0, "東京は遊園地みたいなところさー", 2, 0, "はいたーい。\n喜屋武香織さー。", 1, "喜屋武 香織", 0, 0, 1, 1.4, 1, 1017);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("イオちゃんって呼んでね。", 0, 0, "先生って呼ばれるのは\nくすぐったいから", 2, 0, "支倉伊緒です。", 1, "支倉 伊緒", 0, 0, 1, 1.4, 1, 1018);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ミミをおいてかないでぇ～", 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 2, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, "茜 ミミ", 0, 0, 1, 1.5, 1, 1020);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ふぇぇぇぇぇん……", 0, 0, "あの……\nふぇ……", 2, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, "栗林 くるみ", 0, 0, 1, 1.5, 1, 1021);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("なんてありがとうございます！", 0, 0, "こんな私に貴重な時間を\n割いていただき、", 2, 0, "風宮よりです。\nあああああ！", 1, "風宮 より", 0, 0, 1, 1.4, 1, 1022);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("私こっち行きたいー\nね、早く早くー", 0, 0, "おにいちゃんどこいくの？\nえ？", 2, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, "北条 綾音", 0, 0, 1, 1.5, 1, 1023);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("これて何か違う…\nあああすみません！", 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 2, 0, "わっ…わっ…私、\n天野すずめといいます！", 1, "天野 すずめ", 0, 0, 1, 1.4, 1, 1025);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("離しませんわ………\n絶対に…!!", 0, 0, "あなたは…運命の……\n伴侶……", 2, 0, "……クスクス…私は\n…倉石恵理子……", 1, "倉石 恵理子", 0, 0, 1, 1.4, 1, 1027);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("…そうでしょ？？", 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, "佐々木 咲恋", 0, 0, 1, 1.4, 1, 1028);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("あはは、\n私もまだまだだなぁ～", 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 2, 0, "桜井望だよ！\nよろしくねっ", 1, "桜井 望", 0, 0, 1, 1.4, 1, 1029);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ショーグン、\nワタシと一緒に天下統一デース！", 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 2, 0, "デケデケデンっ！", 1, "ニノン・ジュベール", 0, 0, 1, 1.4, 1, 1030);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("おかしいですね……", 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 2, 0, "上喜しのぶです。\n手元のドクロが父です。", 1, "上喜 しのぶ", 0, 0, 1, 1.4, 1, 1031);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("そう、\nオラのボケに突っ込める相方が…！", 0, 0, "けんども\nそれには足りないモンが…", 2, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, "野戸まひる", 0, 0, 1, 1.5, 1, 1033);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ちょ\nちょっと一杯飲んできます…！", 0, 0, "ちょっと緊張しちゃって…", 2, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, "綾瀬 ゆかり", 0, 0, 1, 1.4, 1, 1034);
