INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 0, "……あ、アラーム。", 2, 0, "柏崎…栞です。", 1, "柏崎 栞", 0, 0, 1, 1.4, 1, 1038);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("野に咲く花が、\n唯一の話相手です。", 0, 0, "私、一人も友達がいなくて……", 2, 0, "ふ、双葉碧です。", 1, "双葉 碧", 0, 0, 1, 1.4, 1, 1040);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("そう思っています。", 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 0, "三角千歌です。", 1, "三角 千歌", 0, 0, 1, 1.4, 1, 1042);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("う、疑ってすまなかったな…", 0, 0, "あぁ？\nお前のそいつの仲間か？", 2, 0, "安芸真琴だ。", 1, "安芸 真琴", 0, 0, 1, 1.4, 1, 1043);
